import axios from "axios";

// const baseURL = "http://localhost:21309/api/";

export default function GetIdUser(user) {
  debugger;
  axios
    .get("ShoppingCart/Login/"+user.EMail)
    .then(function (response) {
      user.idUser = response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
}
